  Wildlife Refuge\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2014-04-24T14:43:41.916538\",\n\t\"name\": \"1989-waterfowl-nesting-study-and-nesting-summary-1984-1989-big-stone-national-wildlife-ref\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The 1989 nesting season marked the sixth
  consecutive and final year that Big Stone personnel have conducted waterfowl nesting
  research. In addition, an experimental predator removal project was initiated in
  1987. Skunk only removal from a unit was carried out and nest data was collected
  and compared to that of a control area where no predator management was conducted.
  This was designed to determine what effect, if any, skunk removal would have on
  overall nesting success and productivity of that area. This predator removal project
  also terminated at the end of the 1989 nesting season. A predator management plan
  and assessment was completed and approved in 1986. The Minnesota Department of Natural
  Resources concurred with this experimental predator management program. Even though
  1989 precipitation was less than that of the 1988 drought year, timely rains and
  adequate runoff dramatically improved breeding conditions on the refuge from those
  extremely poor conditions experienced in 1988. This report will summarize our 1989
  data and compare pertinent nesting data from those previous years studied.\",\n\t\"license_title\":
